def get_surrounding_pixels(image):
    #takes in 32 by 32 by 4 image matrix
    #returns vector of 124 surrounding pixeks

    if isinstance(image,Image):
        image_matrix = np.asarray(image)
    else:
        image_matrix = image

    size = image_matrix.shape[0]

    out = np.zeros((124,4))

    out[0:32,:] = image_matrix[0,0:32,:] #top side
    out[32:64,:] = image_matrix[31,0:32,:] #bottom side
    out[64:94,:] = image_matrix[1:31,0,:] #left side
    out[94:124,:] = image_matrix[1:31,31,:] #right side

    return out.flatten()


def get_movement_pixels(split_image):
    percentage = 0.375

    start = round(CELL_SIZE*percentage)
    end = CELL_SIZE - start
    
    out = split_image[:,start:end,start:end]
    return out
    



