class CNN3(nn.Module):
    def __init__(self, classes: int, dropout_rate = 0):
        
        super().__init__()
        """
        classes: integer that corresponds to the number of classes for CIFAR-10
        """
        self.conv = nn.Sequential(
                        # """ YOUR CODE HERE """
                        nn.Conv2d(3, 32, (3,3)) ,
                        nn.MaxPool2d((2,2)), 
                        nn.LeakyReLU(0.1), 
                        nn.Dropout(dropout_rate),
                        nn.Conv2d(32, 32, (3,3)) ,
                        nn.MaxPool2d((2,2)), 
                        nn.LeakyReLU(0.1),
                        nn.Dropout(dropout_rate)
                        # """ YOUR CODE END HERE """

                    )

        self.fc = nn.Sequential(
                        # """ YOUR CODE HERE """
                        nn.Linear(32,64),
                        nn.LeakyReLU(0.1), 
                        nn.Dropout(dropout_rate),
                        nn.Linear(64,32),
                        nn.LeakyReLU(0.1), 
                        nn.Linear(32,classes)
                        # """ YOUR CODE END HERE """
                    )
        
    def forward(self, x: torch.Tensor) -> torch.Tensor:
        # """ YOUR CODE HERE """
        x = self.conv(x)
        # """ YOUR CODE END HERE """
        x = x.view(x.shape[0], 32, 1).mean(2) # GAP  do not remove this line
        # """ YOUR CODE HERE """
        out = self.fc(x)
        # """ YOUR CODE END HERE """
        return out
