def train(net: nn.Module, X: np.ndarray, y: np.ndarray, min_epoch_loss = 0.0005, lr = 0.005):
    X = torch.tensor(X, dtype=torch.float32)
    y = torch.tensor(y, dtype=torch.long)
    print("min_epoch_loss:",min_epoch_loss)
    print("lr:",lr)

    loss_fn = nn.CrossEntropyLoss()
    optimizer = torch.optim.Adam(net.parameters(), lr=lr)
    for epoch in range(10000):
        optimizer.zero_grad()
        # print(y)
        y_pred = net(X)
        # print("y.shape")
        # print(y.shape)
        # print("output.shape")
        # print(output.shape)
        # print(y)
        # print(output)

        loss = loss_fn(y_pred, y)
        epoch_loss = loss.item()
        loss.backward()
        optimizer.step()
        if epoch % 20 == 0:
            print("epoch:", epoch,"epoch_loss:",epoch_loss )
        if epoch_loss < min_epoch_loss:
            break


def get_image_matrix(image: Image):
    image_matrix = np.asarray(image)
    return image_matrix

def get_seeded_image_matrixes(level, num = 50, start_seed = 0, with_subicons = True, duplicate = True):
    import random
    collectible_objects = [create_coin(), create_key(key_id="key"), create_core(), create_speed_effect(multiplier=2), create_immunity_effect(), create_phasing_effect()]
    image_matrixes = []

    if type(level) == State:
        level = from_state(level)
    original_state = to_state(level)

    eligible = False
    if with_subicons:
        
        for object in level.objects_at((0,0)):
            if object.appearance.priority <= 4:
                eligible = True
                num = num*2
                break
        
    
    for i in range(num*4):
        level = from_state(original_state)

        if eligible and i%2 == 0:
            num_of_subicons = random.randint(1,4)
            collectibles = random.sample(collectible_objects, num_of_subicons)
            for object in collectibles:
                level.add((0,0), object)
        

        level.seed = start_seed + i
        state = to_state(level)
        image = texture.render(state).resize((CELL_SIZE,CELL_SIZE))
        image_matrix = get_image_matrix(image)

        split_channel = np.zeros((3,CELL_SIZE,CELL_SIZE))

        for i in range(3):
            split_channel[i,:,:] = image_matrix[:,:,i]

        if not duplicate:
            for m in image_matrixes:
                if np.all(m==split_channel):
                    break
            else:
                image_matrixes.append(split_channel)
        else:
            image_matrixes.append(split_channel)
        if len(image_matrixes) == num:
            break
    
    return image_matrixes

def get_different_sized_image_matrixes(object_array, num = 50, start_seed = 0, with_subicons = True, duplicate = True):
    import random
    image_matrixes = []

    max_level_width = 15

    
    
    for i in range(num*4):
        width = (i%max_level_width) + 1


        level = Level(
            width=width,
            height=1,
            move_fn=default_move_fn,      
            objective_fn=exit_objective_fn,  
            seed=i               
        )

        for w in range(width):
            level.add((w,0), create_floor())
        

        for object in object_array:
            level.add((0,0), object)

        state = to_state(level)
        image = texture.render(state).resize((CELL_SIZE*width,CELL_SIZE))
        image_matrix = get_image_matrix(image)

        cropped_image_matrix = image_matrix[:CELL_SIZE,:CELL_SIZE,:]

        cropped_image = Image.fromarray(cropped_image_matrix)
        # display(cropped_image)

        image_matrix = cropped_image_matrix

        split_channel = np.zeros((3,CELL_SIZE,CELL_SIZE))

        for i in range(3):
            split_channel[i,:,:] = image_matrix[:,:,i]

        if not duplicate:
            for m in image_matrixes:
                if np.all(m==split_channel):
                    break
            else:
                image_matrixes.append(split_channel)
        else:
            image_matrixes.append(split_channel)
        if len(image_matrixes) == num:
            break
    
    return image_matrixes




